import React from "react";
import ReactDOM from 'react-dom';
import Add from "./App";
import Sub from "./Sub";
import Mult from "./Mult";
import Div from "./Div";


ReactDOM.render(

<>
{Add}
{Sub}
{Mult}
{Div}


</>,
document.getElementById("root")
);
